import "./App.css";
import Page1 from "./components/pages/Page1";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Page2 from "./components/pages/Page2";

export const App: React.FC = () => {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Page1 />
        </Route>
        <Route path="/page2">
          <Page2 />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
